INSERT INTO `kandidat` (`id`, `nama`, `jabatan`, `kelas`, `visi`, `misi`, `gambar`) VALUES
(52, 'Sabitha Sarah', 'ketua', 'XI RPL 1', 'Menciptakan lingkungan sekolah yang berkarakter dan menjadikan OSIS sebagai organisasi yang mengutamakan etika dan toleransi baik sesama siswa maupun guru. Mengoptimalkan kualitas pelajar SMK Telkom 1 Medan yang taat pada Tuhan Yang Maha Esa, berpedoman pada Pancasila, progresif serta mengasah potensi para siswa di bidang akademik maupun non akademik. Memberikan kesempatan yang setara kepada tiap murid tanpa memandang hubungan pertemanan ataupun kekeluargaan untuk menjadikan OSIS sebagai organisasi yang Inklusif,  dan Berintegritas demi menuju prestasi bersama. Membentuk generasi OSIS yang menjunjung tinggi Profesionalisme dan Etika dalam berorganisasi. Memberdayakan anggota MPK serta siswa yang Aktif dan berprestasi. Melakukan peningkatan Kualitas Acara', 'Mengadakan kegiatan diskusi, seminar, atau workshop untuk membahas penerapan nilai-nilai keagamaan dan Pancasila dalam kehidupan sehari-hari guna membangun karakter yang beretika dan penuh toleransi. Mendukung pelaksanaan pembelajaran berbasis proyek atau pembelajaran kontekstual yang dapat meningkatkan pemahaman konsep dan penerapan nilai-nilai keagamaan dan Pancasila. Menerapkan sistem seleksi yang transparan dan objektif, dengan kriteria yang jelas tanpa melibatkan faktor pertemanan atau kekeluargaan. Didukung juga dengan membangun budaya kesetaraan yang anti-nepotisme untuk membangun kesadaran dan sebagai dukungan untuk seluruh siswa yang ingin mengikuti kegiatan OSIS. Membentuk program pelatihan kepemimpinan yang mencakup keterampilan manajerial, komunikasi, dan problem-solving untuk meningkatkan kemampuan anggota MPK dalam memimpin, mengorganisir, dan menyalurkan aspirasi anggota kelas dalam proses pengambilan keputusan dan perencanaan kegiatan OSIS. Merancang program mentoring dan tutor sebaya, di mana siswa berprestasi dapat membimbing, bertukar pikiran, dan memberikan inspirasi kepada siswa lainnya guna menciptakan lingkungan belajar yang saling mendukung. Melakukan evaluasi teratur terhadap proses seleksi dalam keanggotaan panitia dan pelaksanaan acara OSIS. Mencari umpan balik dari siswa dan guru pembina untuk mengidentifikasi hal yang perlu perbaikan dan membuat rencana tindakan untuk mengatasi hal tersebut', 'sara.JPG'),
(53, 'Muhammad Fazli Wahyu Pratama', 'ketua', 'XI RPL 1', 'Menjadikan OSIS yang berkarakter, berintegritas, berprestasi, dan amanah, serta menjadi agen perubahan positif bagi sekolah. Membangun akhlak mulia di kalangan siswa, dengan landasan kokoh pada nilai-nilai Pancasila.', 'Membentuk program-program yang secara khusus mengembangkan karakter positif melalui kegiatan-kegiatan edukatif dan pembinaan. Menanamkan nilai integritas melalui advokasi nilai-nilai etika dalam setiap aspek kehidupan sekolah. Mendorong pencapaian prestasi baik dalam bidang akademis maupun non-akademis, guna menciptakan lingkungan sekolah yang berprestasi. mendorong untuk melaksanakan tanggung jawab dan amanah, menjadikan OSIS sebagai contoh yang dapat dipercaya dan diandalkan. menghasilkan perubahan positif dalam budaya sekolah dan lingkungan belajar. Mengadakan program-program pembinaan akhlak mulia yang berbasis nilai-nilai Pancasila, dengan fokus pada moralitas dan etika. Mendorong partisipasi aktif siswa dalam proses pembuatan keputusan, menjadikan mereka agen perubahan yang efektif di sekolah', 'wahyu.JPG'),
(54, 'Fadilla Anisha', 'ketua', 'XI DKV 1', 'Membentuk kebiasaan beragama, berakhlak, kepedulian terhadap lingkungan, unggul dan bebas berpendapat.', 'Menjadikan pengurus OSIS sebagai contoh yang baik dalam beragama dan bersikap sehingga mampu menjadi contoh kepada siswa/siswi. Meningkatkan kualitas ekstrakulikuler di sekolah agar banyak diminati siswa dan mampu menciptakan prestasi di sekolah maupun di luar sekolah. Menghilangkan kesenjangan antara OSIS dan siswa/siswi lainnya, sehingga mereka berani untuk menyampaikan kritik dan berpendapat.', 'fadilla.JPG'),
(56, 'Aprilya Sparingga Kalvarina', 'sekretaris', 'XI TKJ 1', 'Menjadikan OSIS yang berprestasi dan terpandang di  kalangan siswa. mewujudkan OSIS menjadi organisasi yang  SMART (Santun, Mandiri, Adil, Religius, dan Tekun).', 'Meningkatkan keikutsertaan siswa-siswi pada perlombaan akademik dan non-akademik antarsekolah. Meningkatkan pembinaan keagamaan di lingkungan sekolah. Menggelar acara pentas olahraga dan seni di setiap akhir semester. Mendirikan mading bersama sebagai wadah pertukaran informasi antarsiswa', 'apriliya.JPG'),
(57, 'Melizha Zaskia Br Tarigan', 'sekretaris', 'XI TKJ 1', 'menjadikan smk telkom sebagai tempat siswa/ siswi menggali minat,bakat, serta potensi yang mereka miliki dengan pembentukan lingkungan sekolah yang positif dan menanamkan nilai karakter.', 'mengutaman segala aspek dalam nilaiyang bedasarkan ketuhanan yang maha esa. membuat program osis smk telkom menjadi menarik,serta melaksanakannya dengan rasa tanggung jawab,kreativ,dan inovatif. menciptakan kerukunan dan membudidayakan gotong royong,kerja sama,serta tolong menolong. membangun suatu kegiatan yang berguna untuk pengembangan potensi bakat dan kreativitas siswa', 'melizha.JPG'),
(58, 'Racsya Fryanda Pasaribu', 'sekretaris', 'XI TKJ AXIOO', 'Menjadikan OSIS SMK Telkom 1 Medan sebagai wadah untuk membentuk generasi muda yang berkarakter dan mengembangkan potensi diri baik secara akademik maupun non akademik serta menampung aspirasi dan kreatifitas siswa/i SMK Telkom 1 Medan', 'Menyalurkan minat dan bakat siswa/i SMK Telkom 1 Medan melalui kegiatan ekstrakurikuler dan program kerja OSIS. Mengikutsertakan siswa/i dalam lomba dan kompetisi baik di lingkungan sekolah maupun diluar sekolah. Meningkatkan kedisiplinan dan kemandirian melalui program kerja OSIS. Mengembangkan kinerja serta kualitas OSIS SMK Telkom 1 Medan', 'racsya.JPG'),
(59, 'Tengku Meutya Rizqi Qaishya', 'sekretaris', 'XI DKV 1', 'Menjadikan OSIS SMK Telkom Medan sebagai organisasi demokrasi, kompeten dan terampil', 'Demokrasi berlandaskan evaluasi. menjalin serta meningkatkan relasi yang erat sesama anggota osis dan warga smk telkom medan. menjalin kerjasama yang baik antar sesama ekstrakulikuler lain untuk mewujudkan kekompakam secara internal maupun eksternal', 'meutya.JPG'),
(60, 'Putri Jeva Yhona', 'bendahara', 'XI TJA 1', 'Menjadikan OSIS SMK Telkom Medan sebagai wadah untuk mengembangkan minat dan bakat, sehingga mampu mendedikasikan diri untuk dapat berperan aktif menjalin kerjasama baik internal maupun eksternal di SMK Telkom medan.', 'Mengutamakan Tuhan Yang Maha Esa dalam memulai segala hal. Mampu menjalin keakraban yg positif antar warga sekolah hingga diharapkan mampu mengurangi bullying. Membuka wadah untuk menerika pendapat / masukan dari warga sekolah untuk menyelesaikan masalah. Mengutamakan kebersamaan dan kerjasama dalam tugas dan tanggung jawab osis', 'jeva.JPG'),
(61, 'Nada Fakhirah Nasution', 'bendahara', 'XI DKV 1', 'Mewujudkan manajemen keuangan OSIS yang berbasis pada integritas, keteraturan, keterbukaan, dan akuntabilitas.', 'Mengelola dan memastikan keuangan Osis dengan penuh tanggung jawab dan jujur. Menyusun catatan yang tepat dan menjalankan pelaporan yang jelas mengenai transaksi keuangan OSIS, mencakup pemasukan dan pengeluaran. Memastikan kondisi keuangan yang baik melalui penyediaan laporan keuangan berkala yang terstruktur', 'nada.JPG'),
(62, 'Ezy Hagana Sembiring', 'ketua', 'XI RPL 2', 'Membuat sebuah wadah yang dapat menampung bakat, kemampuan, dan hobi siswa-siswi SMK Telkom, dan menjadi teman sejawat satu sama lain.', 'Cerdas, disiplin, cermat, dan kreatif, kami akan membantu pihak sekolah dan murid-murid untuk terus berinovasi kreatif memperbaharui sikap disiplin', 'ezy.JPG'),
(63, 'Yoshie Angelin Napitupulu', 'bendahara', 'XI DKV 1', 'Menjadi bendahara osis yang jujur, terpercaya, dan tanggung jawab.', 'Mengelola keuangan dengan baik dan bijak di OSIS. Bertanggung jawab dalam keuangan OSIS. Mencatat pemasukan pengeluaran secara teratur. Membuat laporan keuangan OSIS', 'yoshie.JPG');
